        <script type="text/javascript" src="https://unpkg.com/voximplant-websdk@beta"></script>
        <script>
		let call;
            const sdk = VoxImplant.getInstance();
			const login = async () => {
				try {
					await sdk.init();
						console.log("SDK is ready!");
					try {
						await sdk.connect();
						console.log("Connected");
					} catch (e) {
						console.log("Connection failed!");
					}
					try {
						await sdk.login("{{$voximplant_username}}","{{$voximplant_password}}");
						console.log("Logged in!");
						startcall();
						
						
					} catch (e) {
						console.log(e);
					}
				} catch (e) {
					console.log("SDK init failure!");
				}
			};
			login();

			const startcall = () => {
				// prepare settings
				const callSettings = {
					number: '{{$phone_}}',
					customData:'{{$team_voximplant_phone}}',
					videoFlags: {
						sendVideo: false,
						receiveVideo: false
					}
				};


			// start the call
				call = sdk.call(callSettings);

			// subscribe to the events if necessary
				call.addEventListener(VoxImplant.CallEvents.Connected, (e) => {
					console.log(e);
					$('.calling').text('Connected');
				});

				call.addEventListener(VoxImplant.CallEvents.Disconnected, (e) => {
					var duration = 0;
					if(!isNaN(e.call.getCallDuration())){
						duration = e.call.getCallDuration();
					}
					$.ajax({
						url: '<?php echo route("add_voximplant_calllog.ajax"); ?>',
						method: 'GET',
						data: {
						'call_id':e.call.id(), 
						'status':e.call.state(), 
						'phone_':'{{$phone_}}', 
						'duration':duration,
						'source': '{{$team_voximplant_phone}}',
						'vendor_id': '{{$lead_id}}',
						'team_id': '{{$team_id}}'
						},
						success:function(response)
						{
							$('.calling').text('Call disconnected!');
							$('.call-actions').hide();
							$('.back-to-vendors-show').show();
							$('.animation .cercle').hide();
							$('span.icon.ring').css('animation','none');
							$('.on-call-dailpad').hide();
						},
						error: function(response) {
							
						}
					});
					console.log(e);
					console.log(e.call.getCallDuration());
					console.log(e.call.id());
					console.log(e.call.number());
					
					console.log("Call disconnected!");
					
				});
				
				call.addEventListener(VoxImplant.CallEvents.Failed, (e) => {
					
					var duration = 0;
					if(!isNaN(e.call.getCallDuration())){
						duration = e.call.getCallDuration();
					}
					$.ajax({
						url: '<?php echo route("add_voximplant_calllog.ajax"); ?>',
						method: 'GET',
						data: {
						'call_id':e.call.id(), 
						'status':e.call.state(), 
						'phone_':'{{$phone_}}', 
						'duration':duration,
						'source': '{{$team_voximplant_phone}}',
						'vendor_id': '{{$lead_id}}',
						'team_id': '{{$team_id}}'
						},
						success:function(response)
						{
							$('.calling').text('Call failed!');
							$('.call-actions').hide();
							$('.back-to-vendors-show').show();
							$('.animation .cercle').hide();
							$('span.icon.ring').css('animation','none');
							$('.on-call-dailpad').hide();
						},
						error: function(response) {
							
						}
					});
					
					console.log("Call failed!", e);
					
				});
			};
			
			$(document).ready(function(){
				$('.end-call').on('click', function(){
					console.log('dhjsahdahkdjas');
					call.hangup();
					$('.call-actions').hide();
					$('.back-to-vendors-show').show();
					$('.animation .cercle').hide();
					$('span.icon.ring').css('animation','none');
				});
			});
			
			$(document).on('click','#open-dialpad', function(){
				$('.on-call-dailpad').show();
			});
			$(document).on('click','.go-back-to-call', function(){
				$('.on-call-dailpad').hide();
			});
			
			function dialerClick(type, value) {
				
				if (type == 'dial') {
					call.sendTone(value);
				} 
			}
        </script>
